import React from 'react';
import './Style.css';

function Navigator() {
  function clickNavigator(e) {
    console.log(e.target.getAttribute("data-id"))
  }
  return (
    <div className="navigator" onClick={clickNavigator}>
      <div className="content" data-id="车票"> 车票 </div>
      <div className="content" data-id="订单"> 订单 </div>
      <div className="content" data-id="我的"> 我的 </div>
    </div>
  );
}

export default Navigator;
